Explicación adicional: Es un soneto perteneciente al poeta vasco Gabriel Aresti, escrito en castellano pero profundamente vinculado a la cultura vasca, como se aprecia en las referencias a lugares como Guernica y Luno, y en su temática de identidad y pertenencia.
